import React from "react";
import { Navbar, NavbarBrand, Container } from "react-bootstrap";
import { SocialIcon } from "react-social-icons";

class Footer extends React.Component {
  render() {
    return (
      <React.Fragment>
        <div className=" bg-success d-flex justify-content-center ">
          <Navbar color="dark" dark>
            <Container className="d-md-flex flex-column ">
              <NavbarBrand className="h6 small">
                Desarrollado por Mart√≠n Madridejos
              </NavbarBrand>

              <div className="d-md-flex flex-row justify-content-around">
                <SocialIcon
                  url="https://www.facebook.com/Academia-Badalona-Jiujitsu-105699827432603/"
                  className="facebook"
                  target="_blank"
                  bgColor="white"
                  style={{ height: 25, width: 25, margin: "10px" }}
                />

                <SocialIcon
                  url="https://www.instagram.com/badalonajiujitsu/"
                  className="instagram"
                  bgColor="white"
                  target="_blank"
                  style={{ height: 25, width: 25, margin: "10px" }}
                />

                <SocialIcon
                  url="https://www.linkedin.com/in/mart%C3%ADn-madridejos-b832a4212/"
                  className="linkedin"
                  bgColor="green"
                  target="_blank"
                  style={{ height: 25, width: 25, margin: "10px" }}
                />
              </div>
            </Container>
          </Navbar>
        </div>
      </React.Fragment>
    );
  }
}

export default Footer;
